import React from 'react';

const AnswerSection = ({ conversations }) => {
  return (
    <div>
      <h2>Conversations</h2>
      <ul>
        {conversations.map((conv, index) => (
          <li key={index}>
            <strong>You:</strong> {conv.question}
            <br />
            <strong>AI:</strong> {conv.answer}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default AnswerSection;
